import { SET_TEMP_SEARCH, SET_SEARCH_TYPE, SET_SEARCH_KEY } from './search-bar.constants';

export const setTempSearch = (key) => ({
	type: SET_TEMP_SEARCH,
	payload: key
})

export const setSearchType = (type) => ({
	type: SET_SEARCH_TYPE,
	payload: type
})

export const setSearchKey = (word) => ({
	type: SET_SEARCH_KEY,
	payload: word
})
